class Solution:
    def __init__(self, code: str):
        self.code = code

    def min_nop_instructions(self) -> int:
        instructions = self.code.split()
        nops = 0
        for i in range(len(instructions) - 1):
            inst = instructions[i]
            if inst.islower():
                nops += 1
                if inst == "nop":
                    instructions[i] = "nop"
                else:
                    instructions[i] = "jmp"
            elif inst.isupper():
                nops = max(0, nops - 1)
        return nops

